import React from 'react';
import { AppBar, Grid, Button, makeStyles } from '@material-ui/core';
import AccountCircle from '@material-ui/icons/AccountCircle';
import EmailIcon from '@material-ui/icons/Email';
import Controls from '../Components/Controls/Controls';

const useStyles = makeStyles((theme) => ({
    button: {
        margin: 15,
    },
}));
const FormUserDetails = (props: any) => {
    const { nextStep, handleInputChange, values } = props;
    const myContinue = (e: any) => {
        e.preventDefault();
        console.log(values.step);
        nextStep();
    }

    return (
        <Grid container>
            <Controls.Input 
                helpText="Enter your full name."
                icon={<AccountCircle />}
                required
                type="text"
                label="Full Name"
                name="fullName"
                value={values.fullName}
                onInput={handleInputChange}
                // error={errors.fullName}
            />
            <Controls.Input 
                helpText="Enter your email."
                icon={<EmailIcon />}
                required
                type="text"
                label="Email"
                name="email"
                value={values.email}
                onInput={handleInputChange}
                // error={errors.email}
            />
            <Controls.MyButton
                text="Continue"
                color="primary"
                onClick={myContinue}
            />
        </Grid>
    )
}

export default FormUserDetails;
